      body: '### What happened?\n\nWhen I jump forward the cluster time by one day, I find that all nodes will briefly become "NotReady", like this, after about 10s, nodes will become "Ready" again.\r\n\r\nI found that the node lease resource normally updates the renewtime to a day ago in a nodeStatusUpdateFrequency period, and only kube-controller-manager thinks that the node has exceeded the heartbeat detection cycle, log like this:\r\n```\r\nI0404 15:28:36.488138       8 node_lifecycle_controller.go:1107] node paas-192-168-21-186 hasn\'t been updated for 1m26.899981721s. Last PIDPressure is: &NodeCondition{Type:PIDPressure,Status:Unknown,LastHeartbeatTime:2022-04-05 15:22:52 +0500 DSTD,LastTransitionTime:2022-04-04 15:28:30 +0500 DSTD,Reason:NodeStatusUnknown,Message:Kubelet stopped posting node status.,}\r\nI0404 15:28:36.488183       8 node_lifecycle_controller.go:897] Node paas-192-168-21-186 is unresponsive as of 2022-04-04 15:28:36.488176491 +0500 DSTD m=+237.395296883. Adding it to the Taint queue.\r\nI0404 15:28:46.506843       8 node_lifecycle_controller.go:908] Node paas-192-168-21-186 is healthy again, removing all taints\r\n```\r\n\n\n### What did you expect to happen?\n\nWhen time jumps forward, nodes should remain ready status.\n\n### How can we reproduce it (as minimally and precisely as possible)?\n\nJump the cluster time forward for more than one heartbeat detection cycle(nodeStatusUpdateFrequency period).\n\n### Anything else we need to know?\n\nI think this problem is that `node_life_cycle_controller(kube-controller-manager)` does not consider the time jump forward scenario when doing node health detection.\r\n\r\nRelated code snippet:\r\nIn `kubernetes/pkg/controller/nodelifecycle/node_lifecycle_controller.go`, function `tryUpdateNodeHealth()` will check a given node\'s conditions and tries to update it. Only when `savedLease.Spec.RenewTime.Before(observedLease.Spec.RenewTime)`  will update nodeHealth probeTimestamp.\r\n\r\nhttps://github.com/kubernetes/kubernetes/blob/e4fe90e6ef796583b81a559364a241579efc3593/pkg/controller/nodelifecycle/node_lifecycle_controller.go#L1055-L1063\r\n\r\nWhen `nc.now().After(nodeHealth.probeTimestamp.Add(gracePeriod))`, it will update node to NotReady. \r\n> **When the cluster time jumps forward**,  `savedLease.Spec.RenewTime` is newer than `observedLease.Spec.RenewTime`, so nodeHealthy.probeTimestamp will no refresh, and here use the go monotonic clock, so this judgment condition will be established.\r\n\r\nhttps://github.com/kubernetes/kubernetes/blob/e4fe90e6ef796583b81a559364a241579efc3593/pkg/controller/nodelifecycle/node_lifecycle_controller.go#L1065-L1101\r\n\r\nWhen next `nodeStatusUpdateFrequency` period become, `kubelet` will `syncNodeStatus()`, and refresh node `Ready` again.\r\n\r\nPossible fixes:\r\nWhen `kubelet` had refresh lease, `node_life_cycle_controller` should think the node is ok.\r\n![image](https://user-images.githubusercontent.com/40355276/159239638-de71f520-0b76-4cb1-8e9b-a29bd9b9c9f8.png)\r\n\n\n### Kubernetes version\n\n<details>\r\n\r\n```console\r\n$ kubectl version\r\nv1.22.1\r\n```\r\n\r\n</details>\r\n\n\n### Cloud provider\n\n<details>\r\nNot using cloud provider\r\n</details>\r\n\n\n### OS version\n\n<details>\r\n\r\n```console\r\n# On Linux:\r\n$ cat /etc/os-release\r\nNAME="EulerOS"\r\nVERSION="2.0 (SP9x86_64)"\r\nID="euleros"\r\nVERSION_ID="2.0"\r\nPRETTY_NAME="EulerOS 2.0 (SP9x86_64)"\r\nANSI_COLOR="0;31"\r\n$ uname -a\r\nLinux PaaSCore-1 4.18.0-147.5.1.0.h208.eulerosv2r9.x86_64 #1 SMP Sun Sep 27 12:47:01 UTC 2020 x86_64 x86_64 x86_64 GNU/Linux\r\n\r\n```\r\n\r\n</details>\r\n\n\n### Install tools\n\n<details>\r\nI installed with source code, the tag is release-1.22\r\n</details>\r\n\n\n### Container runtime (CRI) and version (if applicable)\n\n<details>\r\n</details>\r\n\n\n### Related plugins (CNI, CSI, ...) and versions (if applicable)\n\n<details>\r\n\r\n</details>\r\n',
