      body: "Sorry, it's my first time to submit a question, I'm not very good at using it, the following is my question\r\n\r\nI executed kubectl get pod but not normal return\r\n```\r\nThe connection to the server localhost:8080 was refused - did you specify the right host or port?\r\n```\r\n\r\nand I found that after executing kubectl config view\r\n\r\n```\r\napiVersion: v1\r\nclusters: null\r\ncontexts: null\r\ncurrent-context: \"\"\r\nkind: Config\r\npreferences: {}\r\nusers: null\r\n```\r\nThis is the return, but the pod of the cluster is still running normally, I use kubectl get pod --kubeconfig=kubelet.kubeconfig It is possible to return normally\r\n\r\n\r\nAnd the message log also has this output\r\n```\r\nMar 21 16:16:10 k8s-master1 kube-controller-manager: E0321 16:16:10.848600   30618 leaderelection.go:320] error retrieving resource lock kube-system/kube-controller-manager: Get http://127.0.0.1:8080/api/v1/namespaces/kube-system/endpoints/kube-controller-manager?timeout=10s: net/http: request canceled while waiting for connection (Client.Timeout exceeded while awaiting headers)\r\nMar 21 16:16:12 k8s-master1 kube-scheduler: E0321 16:16:12.692066   29827 reflector.go:178] k8s.io/client-go/informers/factory.go:135: Failed to list *v1beta1.PodDisruptionBudget: Get http://127.0.0.1:8080/apis/policy/v1beta1/poddisruptionbudgets?limit=500&resourceVersion=0: dial tcp 127.0.0.1:8080: i/o timeout\r\n```\r\n\r\nI restarted the service but it has left it unreachable\r\nHope to get response and answer, thank you\r\n",
