      active_lock_reason: null,
      body: '### What happened?\n\nI create a ResourceQuota with two pods limit in my `test` namespace.\r\n```\r\nroot@k8s-local-control-plane:/# kubectl get resourceQuota -n test -o wide\r\nNAME       AGE   REQUEST     LIMIT\r\npods-two   67m   pods: 0/2\r\n```\r\nThen, I create a statefuleSet `busybox` with 3 replicas. As  expected, two pods are created  successfully, and the third pod failed to create.\r\n```\r\nroot@k8s-local-control-plane:/# kubectl get po -n test\r\nNAME        READY   STATUS    RESTARTS   AGE\r\nbusybox-0   1/1     Running   0          3m9s\r\nbusybox-1   1/1     Running   0          3m5s\r\n```\r\nBut, the ReadyReplicas is not 2 ,but 1.\r\n```\r\nroot@k8s-local-control-plane:/# kubectl get sts -o wide -n test\r\nNAME      READY   AGE     CONTAINERS   IMAGES\r\nbusybox   1/3     4m53s   busybox      busybox:latest\r\nroot@k8s-local-control-plane:/# kubectl get sts busybox -n test -o=jsonpath="{.status.readyReplicas}"\r\n1\r\n```\n\n### What did you expect to happen?\n\nThe ReadyReplicas is correct\n\n### How can we reproduce it (as minimally and precisely as possible)?\n\n1、Create a ResourceQuota with two pods limit in  a new namespace.\r\n2、Create a statefulSet with 3 replicas \r\n3、Check if the ReadyReplicas of statefulSet matchs the number of stateful running pods.\n\n### Anything else we need to know?\n\nhttps://github.com/kubernetes/kubernetes/blob/816c97ab8cff8a1c72eccca1026f7820e93e0d25/pkg/controller/statefulset/stateful_set_control.go#L106-L114\r\n1、According to the logic of the statefulSet controller, new pod created in current sync is not be immediately counted into the ReadyReplicas.\r\n2、Failure to create pod will cause `updateStatefulSet` to return error,  then skip updating status.\n\n### Kubernetes version\n\n<details>\r\n\r\n```console\r\n$ kubectl version\r\nClient Version: version.Info{Major:"1", Minor:"23", GitVersion:"v1.23.3", GitCommit:"816c97ab8cff8a1c72eccca1026f7820e93e0d25", GitTreeState:"clean", BuildDate:"2022-01-26T08:02:07Z", GoVersion:"go1.17.6", Compiler:"gc", Platform:"linux/amd64"}\r\nServer Version: version.Info{Major:"1", Minor:"23", GitVersion:"v1.23.3", GitCommit:"816c97ab8cff8a1c72eccca1026f7820e93e0d25", GitTreeState:"clean", BuildDate:"2022-01-26T08:02:07Z", GoVersion:"go1.17.6", Compiler:"gc", Platform:"linux/amd64"}\r\n```\r\n\r\n</details>\r\n\n\n### Cloud provider\n\n<details>\r\n\r\n</details>\r\n\n\n### OS version\n\n<details>\r\nkind v1.23.3\r\n</details>\r\n\n\n### Install tools\n\n<details>\r\n\r\n</details>\r\n\n\n### Container runtime (CRI) and version (if applicable)\n\n<details>\r\n\r\n</details>\r\n\n\n### Related plugins (CNI, CSI, ...) and versions (if applicable)\n\n<details>\r\n\r\n</details>\r\n',
