      body: "<!--  Thanks for sending a pull request!  Here are some tips for you:\r\n\r\n1. If this is your first time, please read our contributor guidelines: https://git.k8s.io/community/contributors/guide/first-contribution.md#your-first-contribution and developer guide https://git.k8s.io/community/contributors/devel/development.md#development-guide\r\n2. Please label this pull request according to what type of issue you are addressing, especially if this is a release targeted pull request. For reference on required PR/issue labels, read here:\r\nhttps://git.k8s.io/community/contributors/devel/sig-release/release.md#issuepr-kind-label\r\n3. Ensure you have added or ran the appropriate tests for your PR: https://git.k8s.io/community/contributors/devel/sig-testing/testing.md\r\n4. If you want *faster* PR reviews, read how: https://git.k8s.io/community/contributors/guide/pull-requests.md#best-practices-for-faster-reviews\r\n5. If the PR is unfinished, see how to mark it: https://git.k8s.io/community/contributors/guide/pull-requests.md#marking-unfinished-pull-requests\r\n-->\r\n\r\n**What type of PR is this?**\r\n\r\n<!--\r\nAdd one of the following kinds:\r\n/kind bug\r\n/kind cleanup\r\n/kind documentation\r\n/kind feature\r\n/kind design\r\n\r\n\r\nOptionally add one or more of the following kinds if applicable:\r\n/kind api-change\r\n/kind deprecation\r\n/kind failing-test\r\n/kind flake\r\n/kind regression\r\n-->\r\n/kind bug   \r\n\r\n**What this PR does / why we need it**:\r\n\r\nas reported in issue #103838 and discussed in #102525, a concurrent read-and-write for calling Allocate in device manager may cause Kubelet to panic, all because of the re-allocating logic if a pod has already been removed from activePods\r\n\r\n**Which issue(s) this PR fixes**:\r\n<!--\r\n*Automatically closes linked issue when PR is merged.\r\nUsage: `Fixes #<issue number>`, or `Fixes (paste link of issue)`.\r\n_If PR is about `failing-tests or flakes`, please post the related issues/tests in a comment and do not use `Fixes`_*\r\n-->\r\nFixes #103838, and I also add some test cases\r\n\r\n**Special notes for your reviewer**:\r\n\r\nwe can reproduce it by this steps:\r\n1. pod-1 request for a device, and is successfully admitted\r\n2. before  pod-1 is successfully started, a deletion is called for it, but one go-routine has already started to create containers for it; in that cases, pod-1 is removed from PodManager, and activePods will not find it anymore\r\n3.  pod-2 request for a device, and is successfully admitted; in that case, during Allocate process of pod-2, it will call UpdateAllocatedDevices and set pendingAdmissionPod=pod-2 instead of pod-1, and clear pod-1 from podDevices\r\n4. pod-1 goes to the logic of GetDeviceRunContainerOptions, it will find that podDevices doesn't contain pod-1, since it calls Allocate again\r\n5. when pod-1 goes to allocateContainerResources function, pod-3 request for a device, and goes to admission logic; so when it calls Allocate, it will remove pod-1 from deviceToResue\r\n6. when pod-1 comes back from  allocateContainerResources function, deviceToResue for pod-1 is nil, which will cause the panic in addContainerAllocatedResources and removeContainerAllocatedResources\r\n\r\n\r\n**Does this PR introduce a user-facing change?**:\r\n```release-note\r\nSkip re-allocate logic if pod is already removed to avoid panic\r\n```",
