      active_lock_reason: null,
      body: "### What would you like to be added?\n\nI see that the  [`k8s.io/csi-api`](https://git.k8s.io/csi-api) repository does no longer have a staging pkg.\r\nIt looks like the staging pkg existed from K8s 1.9 to 1.14 (according to the repo tags).\r\nI would suggest sig-storage to consider archiving this repo if it is no longer used and not supposed to be used. Of course, we should also consider eventual usage of this repo currently (existing dependency in go.mod of third-party project) and we have to handle this properly making sure we don't break the build of any existing project.\n\n### Why is this needed?\n\nFor cleanup purposes.",
