      updated_at: "2022-03-20T15:14:59Z",
      closed_at: null,
      author_association: "MEMBER",
      active_lock_reason: null,
      body: "### What would you like to be added?\n\nComponents like kube-apiserver, controller-manager, scheduler, have dozens of options to pass through cmd flags,\r\nwhich seems clunky.\r\nSo can we use a single config file to pass so many args to components, like this:\r\n```\r\nkube-apiserver --config=/path/to/config.yaml\r\n```\r\ninstead of currently cmd flags below:\r\n```\r\nkube-apiserver --advertise-address=xxx --allow-privileged=true --authorization-mode=Node,RBAC ...\r\n```\n\n### Why is this needed?\n\n1. Manually config so many cmd flags is clunky and hard to maintain.\r\n2. When debug the component, it is not easy to get all the flags currently in use.\r\n\r\nThus, with a single config file, it is easy to config, maintain and debug.",
