      pull_request: {
        url: "https://api.github.com/repos/kubernetes/kubernetes/pulls/108817",
        html_url: "https://github.com/kubernetes/kubernetes/pull/108817",
        diff_url: "https://github.com/kubernetes/kubernetes/pull/108817.diff",
        patch_url: "https://github.com/kubernetes/kubernetes/pull/108817.patch",
        merged_at: null,
      },
      body: "#### What type of PR is this?\r\n\r\n/kind feature\r\n\r\n#### What this PR does / why we need it:\r\n\r\n#### Which issue(s) this PR fixes:\r\n\r\nFixes https://github.com/kubernetes-sigs/kustomize/issues/1424\r\n\r\n/cc @natasha41575 \r\n\r\n#### Special notes for your reviewer:\r\n\r\n⚠️ This could break `kubectl kustomize` for users in the unusual case where they've named their Kustomization directory exactly \"version\". This problem does not exist in standalone Kustomize thanks to the subcommand structure  (Sidenote: I don't know why it isn't `kubectl kustomize build` and I wish it were, for UX consistency).  I considered doing `kubectl kustomize --version` instead, but decided against it for two reasons. First, that is inconsistent with both existing version commands: `kubectl version` and `kustomize version`. Second, it would be a mess to implement, because the `kubectl kustomize` command implementation is provided directly by the `kustomize build` command code, which logically should not have/support that flag.\r\n\r\n\r\nThe first commit scripts the manual process outlined in the [Kustomize release docs](https://github.com/kubernetes-sigs/kustomize/tree/master/releasing#update-kustomize-in-kubectl). Demo: https://github.com/KnVerey/kubernetes/pull/1. I chose `hack/` as the location for this script since it uses utilities from there and invokes several of that directory's scripts. Let me know if it belongs somewhere else.\r\n\r\n\r\nThe second commit takes advantage of the new script to programmatically embed the version number of the release we're updating to, and exposes it as `kubectl kustomize version`. Initially it is set to 4.4.1: [go.mod ](https://github.com/kubernetes/kubernetes/blob/master/go.mod#L488) / [PR](https://github.com/kubernetes/kubernetes/pull/106389). I considered having the Kustomize code itself permanently embed the version number, instead of dynamically embedding it at build time (which makes it unavailable to kubectl). However, I don't think that approach actually makes sense, given that it would expose an official version number during dev builds, and to other tools's composite commands built off arbitrary points in the repo history. If you have an idea for an alternative approach, lmk.\r\n\r\n```bash\r\n༶ _output/bin/kubectl kustomize -h\r\nBuild a set of KRM resources using a 'kustomization.yaml' file. The DIR argument must be a path to a directory\r\ncontaining 'kustomization.yaml', or a git repository URL with a path suffix specifying same with respect to the\r\nrepository root. If DIR is omitted, '.' is assumed.\r\n\r\nExamples:\r\n  # Build the current working directory\r\n  kubectl kustomize\r\n\r\n  # Build some shared configuration directory\r\n  kubectl kustomize /home/config/production\r\n\r\n  # Build from github\r\n  kubectl kustomize https://github.com/kubernetes-sigs/kustomize.git/examples/helloWorld?ref=v1.0.6\r\n\r\nAvailable Commands:\r\n  version     Print the version of `kustomize build` that `kubectl kustomize` embeds.\r\n# [help output truncated]\r\n\r\n༶ _output/bin/kubectl kustomize version\r\nv4.4.1\r\n```\r\n\r\n#### Does this PR introduce a user-facing change?\r\n\r\n```release-note\r\nAdds a version subcommand to `kubectl kustomize`\r\n```\r\n\r\n#### Additional documentation e.g., KEPs (Kubernetes Enhancement Proposals), usage docs, etc.:\r\n\r\n<!--\r\nThis section can be blank if this pull request does not require a release note.\r\n\r\nWhen adding links which point to resources within git repositories, like\r\nKEPs or supporting documentation, please reference a specific commit and avoid\r\nlinking directly to the master branch. This ensures that links reference a\r\nspecific point in time, rather than a document that may change over time.\r\n\r\nSee here for guidance on getting permanent links to files: https://help.github.com/en/articles/getting-permanent-links-to-files\r\n\r\nPlease use the following format for linking documentation:\r\n- [KEP]: <link>\r\n- [Usage]: <link>\r\n- [Other doc]: <link>\r\n-->\r\n```docs\r\n\r\n```\r\n",
