      active_lock_reason: null,
      body: '### What happened?\n\nCluster api provides a framework to run the e2e tests which uses the conformance image:\r\n\r\nhttps://github.com/kubernetes-sigs/cluster-api/blob/692497dbb340beecc04171ccd73f370f173da3a9/test/framework/kubetest/run.go#L43-L44\r\n\r\nThe gmsa tests use bash to install the webhook:\r\n\r\nhttps://github.com/kubernetes/kubernetes/blob/4d08582d1fa21e1f5887e73380001ac827371553/test/e2e/windows/gmsa_full.go#L339-L344\r\n\r\nThe test will fail when run in the conformance image because of the bash:\r\n\r\n```\r\n• Failure [9.850 seconds]                                                                                         \r\n[sig-windows] [Feature:Windows] GMSA Full [Serial] [Slow]                                                         \r\ntest/e2e/windows/framework.go:27                                                                                  \r\n  GMSA support                                                                                                    \r\n  test/e2e/windows/gmsa_full.go:96                                                                                \r\n    can read and write file to remote SMB folder [It]                                                             \r\n    test/e2e/windows/gmsa_full.go:174                                                                             \r\n\r\n    Mar 18 22:43:47.188: unable to deploy GMSA webhook, output:                                                   \r\n    : exec: "bash": executable file not found in $PATH     \r\n```\n\n### What did you expect to happen?\n\nwe should install the component another way\n\n### How can we reproduce it (as minimally and precisely as possible)?\n\nrun this e2e conformance image with `--ginkgo.focus="GMSA.Full"`\n\n### Anything else we need to know?\n\n/sig windows\r\nfyi @iXinqi\n\n### Kubernetes version\n\n<details>\r\n\r\n```console\r\n$ kubectl version\r\n# paste output here\r\n```\r\n\r\n</details>\r\n\n\n### Cloud provider\n\n<details>\r\n\r\n</details>\r\n\n\n### OS version\n\n<details>\r\n\r\n```console\r\n# On Linux:\r\n$ cat /etc/os-release\r\n# paste output here\r\n$ uname -a\r\n# paste output here\r\n\r\n# On Windows:\r\nC:\\> wmic os get Caption, Version, BuildNumber, OSArchitecture\r\n# paste output here\r\n```\r\n\r\n</details>\r\n\n\n### Install tools\n\n<details>\r\n\r\n</details>\r\n\n\n### Container runtime (CRI) and version (if applicable)\n\n<details>\r\n\r\n</details>\r\n\n\n### Related plugins (CNI, CSI, ...) and versions (if applicable)\n\n<details>\r\n\r\n</details>\r\n',
