      author_association: "MEMBER",
      active_lock_reason: null,
      body: "/sig node\r\n/sig instrumentation\r\n/kind feature\r\n/priority backlog\r\n\r\nIt will be useful to log successful probes execution details with higher verbosity once in a while. With the default verbosity no information on successful probe execution is reported. Which is fine as it typically very verbose and rarely needed. However if somebody investigating a problem with probes and cannot make sense why they are not failing when expected to fail, logs would be very interesting.\r\n\r\nOne suggestion may be to log successful probe execution logs with higher verbosity once in 15 minutes or so. This will make sure that logs are not too verbose, while allowing troubleshooting without changing verbosity to higher level.",
