      author_association: "CONTRIBUTOR",
      active_lock_reason: null,
      body: "projected volumes exclude ephemeral containers in calculating fs user because \"SecurityContext is not allowed\" :\r\n\r\nhttps://github.com/kubernetes/kubernetes/blob/0ade4678a7ba527d22f6baa81034dea423267608/pkg/volume/util/util.go#L625-L626\r\n\r\nThis is no longer technically correct -- ephemeral containers are allowed to specify security context -- but it's a no-op because `ephemeralContainers` is guaranteed to be empty at pod creation when fs user is calculated. Still, the comment is wrong so let's clean it up to avoid confusion.\r\n\r\n/kind cleanup",
