      author_association: "MEMBER",
      active_lock_reason: null,
      body: "### What would you like to be added?\r\n\r\n1. `Configurator` seems redundant today as it only holds a method of `create` initializing several components, so I'd like to unroll `scheduler.New`  by moving the `create` logic to `scheduler.New`, then `Configurator` can be removed. The benefits: \r\na) No need to maintain the `Configurator` struct\r\nb) Take all the logics in a glance, easy to read. Before, `create` did a lot of things. https://github.com/kubernetes/kubernetes/blob/aface3ab99b5c8c6ac8c4892c8019742075a461d/pkg/scheduler/factory.go#L49-L86\r\n\r\n3. What's more, `newScheduler` function is hard to maintain especially in tests, I'd like to refactor this with closure like `func WithProfiles(p ...schedulerapi.KubeSchedulerProfile) Option` we used in `New` scheduler. https://github.com/kubernetes/kubernetes/blob/aface3ab99b5c8c6ac8c4892c8019742075a461d/pkg/scheduler/scheduler_test.go#L2435-L2445\r\n\r\nSo I'd like to separate this into two subtasks:\r\n\r\n- [ ] unroll `scheduler.New` and remove `Configurator`\r\n- [ ] refactor `newScheduler` with closure\r\n\r\n### Why is this needed?\r\n\r\nEasy to maintain codes.",
