      active_lock_reason: null,
      body: "### What happened?\n\nAs discussed in https://github.com/kubernetes/kubernetes/issues/108267, Endpoint(Slice) controllers can get stuck if an Endpoints or EndpointSlice resource is stuck in a terminating state. \n\n### What did you expect to happen?\n\nI don't think there's much we can do for Endpoints here since the same name is reused, but EndpointSlice controllers can ignore EndpointSlices in a terminating state.\n\n### How can we reproduce it (as minimally and precisely as possible)?\n\nSee https://github.com/kubernetes/kubernetes/issues/108267\n\n### Anything else we need to know?\n\n_No response_\n\n### Kubernetes version\n\nAll supported versions\n\n### Cloud provider\n\nAny\n\n### OS version\n\nAny\n\n### Install tools\n\nAny\n\n### Container runtime (CRI) and version (if applicable)\n\nAny\n\n### Related plugins (CNI, CSI, ...) and versions (if applicable)\n\nAny",
