      author_association: "NONE",
      active_lock_reason: null,
      body: '### What happened?\n\nA job got created by helm as a pre-upgrade hook; the pod for it got created, but the pod failed to start the container: \r\n```\r\n1 Failed: Error: failed to start container "post-install-job": Error response from daemon: cannot join network of a non running container: a1bd48a639...\r\n\r\nEvents emitted by the kubelet seen at 2022-03-15 21:42:08 +0000 UTC since 2022-03-15 21:42:08 +0000 UTC\r\n```\r\nThe pod does not seem seem to have reported an error, since helm continued onto the main stage of the release. \r\n\r\nYes I know this could be a bug on helm side, but it seems more likely to be a bug in kubernetes. Eg, the fact that it is a warning, rather than an error, suggests the pod probably exited with code 0. \r\n\r\n\n\n### What did you expect to happen?\n\nThe warning should have been an error. \r\nThe pod should have failed.\r\n\n\n### How can we reproduce it (as minimally and precisely as possible)?\n\nI do not know what caused this in the first place. \r\n\r\nI could not find Go code for pieces of that error message, so I can\'t check when/where it happens. \n\n### Anything else we need to know?\n\n_No response_\n\n### Kubernetes version\n\n<details>\r\n\r\n```console\r\n$ kubectl version\r\n1.20\r\n```\r\n\r\n</details>\r\n\n\n### Cloud provider\n\n<details>\r\naws eks\r\n</details>\r\n\n\n### OS version\n\n<details>\r\n\r\n```console\r\n# On Linux:\r\n$ cat /etc/os-release\r\n# paste output here\r\n$ uname -a\r\n# paste output here\r\n\r\n# On Windows:\r\nC:\\> wmic os get Caption, Version, BuildNumber, OSArchitecture\r\n# paste output here\r\n```\r\n\r\n</details>\r\n\n\n### Install tools\n\n<details>\r\n\r\n</details>\r\n\n\n### Container runtime (CRI) and version (if applicable)\n\n<details>\r\n\r\n</details>\r\n\n\n### Related plugins (CNI, CSI, ...) and versions (if applicable)\n\n<details>\r\n\r\n</details>\r\n',
