      body: '### Failure cluster [03a28923a9772498aaf8](https://go.k8s.io/triage#03a28923a9772498aaf8)\r\n\r\nTest: [sig-node] Restart [Serial] [Slow] [Disruptive] Kubelet should correctly account for terminated pods after restart\r\n\r\n##### Error text:\r\n```\r\ntest/e2e_node/restart_test.go:142\r\nMar  4 09:00:41.495: Failed to run sufficient restartAlways pods, got 3 but expected 4\r\nvendor/github.com/onsi/ginkgo/internal/leafnodes/runner.go:113\r\n```\r\n\r\nI\'ve also seen\r\n\r\n```\r\n{ Failure test/e2e_node/restart_test.go:142\r\nMar 16 21:28:06.720: Failed to run sufficient restartNever pods, got 0 but expected 1\r\nvendor/github.com/onsi/ginkgo/internal/leafnodes/runner.go:113}\r\n```\r\n\r\non https://prow.k8s.io/view/gs/kubernetes-jenkins/logs/ci-kubernetes-node-kubelet-serial-cri-o/1504190296534028288\r\n\r\n#### Recent failures:\r\n[3/16/2022, 1:18:16 PM ci-kubernetes-node-kubelet-serial-cri-o](https://prow.k8s.io/view/gs/kubernetes-jenkins/logs/ci-kubernetes-node-kubelet-serial-cri-o/1504190296534028288)\r\n[3/12/2022, 12:10:12 AM ci-kubernetes-node-kubelet-serial-cri-o](https://prow.k8s.io/view/gs/kubernetes-jenkins/logs/ci-kubernetes-node-kubelet-serial-cri-o/1502557516268048384)\r\n[3/6/2022, 7:55:56 AM ci-kubernetes-node-kubelet-serial-cri-o](https://prow.k8s.io/view/gs/kubernetes-jenkins/logs/ci-kubernetes-node-kubelet-serial-cri-o/1500500414972301312)\r\n[3/4/2022, 12:45:54 AM ci-kubernetes-node-kubelet-serial-containerd](https://prow.k8s.io/view/gs/kubernetes-jenkins/logs/ci-kubernetes-node-kubelet-serial-containerd/1499667417851236352)\r\n\r\n\r\n/kind flake\r\n/sig node\r\n\r\n\r\nLooks like occasionally we have a second 50m CPU pod hanging around on the node, blocking enough pods getting scheduled for the test:\r\n\r\n```\r\nI0316 21:25:06.552690  172062 config.go:384] "Receiving a new pod" pod="restart-test-721/test-179d535e-98f2-4a77-9a56-27fd9c16901e"\r\nI0316 21:25:06.552726  172062 kubelet.go:2039] "SyncLoop ADD" source="api" pods=[restart-test-721/test-179d535e-98f2-4a77-9a56-27fd9c16901e]\r\nI0316 21:25:06.552746  172062 topology_manager.go:200] "Topology Admit Handler"\r\nI0316 21:25:06.552760  172062 manager.go:914] "Looking for needed resources" needed=1 resourceName="cpu"\r\nI0316 21:25:06.552829  172062 predicate.go:130] "Predicate failed on Pod" pod="restart-test-721/test-179d535e-98f2-4a77-9a56-27fd9c16901e" err="Node didn\'t have enough resource: cpu, requested: 950, used: 100, capacity: 1000"\r\n```\r\n\r\nI\'m a bit puzzled because no pods are listed as currently running when the node dumps debug info. Could be a bug?',
