      author_association: "MEMBER",
      active_lock_reason: null,
      body: "### What would you like to be added?\n\nA mechanism to better document fields that accepts a set of built-in values besides any value.\n\n### Why is this needed?\n\nMany fields of our current API types accept both built-in and custom values. For example, [PodConditionType](https://github.com/kubernetes/kubernetes/blob/v1.23.4/staging/src/k8s.io/api/core/v1/types.go#L2639) can be any of `PodScheduled`, `Ready`, `Initialized`, `ContainersReady`, or any custom condition set by the application, see [https://kubernetes.io/docs/concepts/workloads/pods/pod-lifecycle/#pod-readiness-gate](https://kubernetes.io/docs/concepts/workloads/pods/pod-lifecycle/#pod-readiness-gate).\r\n\r\nOur current OpenAPI documentation represents close enums as enum types, but there is no support for fields that may be either. We can add comments directly to the affected fields or develop a mechanism to automate it.",
