      author_association: "NONE",
      active_lock_reason: null,
      body: '### What happened?\r\n\r\nThe situation is pretty good described in a comment [here](https://github.com/kubernetes/kubernetes/issues/86914#issuecomment-571931346).\r\nThe kubectl flag names "--force" and "--grace-period" and corresponding help indicate an IMMEDIAT deletion of the pod and kill of corresponding containers.\r\n\r\nActual behaviour:\r\n- The kube api ressource is deleted immediatly\r\n- The corresponding container(s) of the pod receive a SIGTERM signal, and SIGKILL is sent after "terminationGracePeriodSeconds" of the pod (30s in my case).\r\n\r\nThe unexpected behaviour is not obvious, because when you use the command with a container that reacts on SIGTERM quickly, you won\'t see the difference.\r\n\r\nWe used that command to test the behaviour of leader-election based StatefulSets.\r\n\r\n### What did you expect to happen?\r\n\r\nExpected behaviour:\r\n- The kube api ressource is deleted immediatly\r\n- The corresponding container(s) of the pod receive a SIGKILL signal immediatly, not after "terminationGracePeriodSeconds" of the pod (30s in my case).\r\n\r\n### How can we reproduce it (as minimally and precisely as possible)?\r\n\r\nterminal1:\r\n- kubectl run test-pod --image docker-quay-io.prod.bk.dfs/strimzi/kafka:0.27.0-kafka-2.8.0 --command -- bash -c "trap \'echo SIGTERM received\' SIGTERM; trap \'echo SIGINT received\' SIGINT; while [ 1 ]; do date; echo sleeping; sleep 1; done"\r\n- kubectl logs -f test-pod\r\n\r\nterminal2:\r\n- kubectl delete pod test-pod --force --grace-period 0\r\n\r\nObserve ~30s between SIGTERM and container termination\r\n```\r\nWed Mar 16 16:34:57 UTC 2022\r\nsleeping\r\nSIGTERM received\r\n...\r\nWed Mar 16 16:35:28 UTC 2022\r\nsleeping\r\n```\r\n\r\n\r\n### Anything else we need to know?\r\n\r\nThe best workaround is to use --grace-period 0 WITHOUT the --force flag.\r\nThat will send the SIGKILL directly after SIGTERM as it seems.\r\n\r\n### Kubernetes version\r\n\r\n<details>\r\n\r\n```console\r\nClient Version: version.Info{Major:"1", Minor:"23", GitVersion:"v1.23.2", GitCommit:"9d142434e3af351a628bffee3939e64c681afa4d", GitTreeState:"clean", BuildDate:"2022-01-19T17:35:46Z", GoVersion:"go1.17.5", Compiler:"gc", Platform:"linux/amd64"}\r\nServer Version: version.Info{Major:"1", Minor:"22", GitVersion:"v1.22.3+e790d7f", GitCommit:"3a0f2c90b43e6cffd07f57b5b78dd9f083e47ee2", GitTreeState:"clean", BuildDate:"2021-12-14T02:10:38Z", GoVersion:"go1.16.6", Compiler:"gc", Platform:"linux/amd64"}\r\n```\r\n\r\n</details>\r\n\r\n\r\n### Cloud provider\r\n\r\nN/A\r\n\r\n### OS version\r\n\r\n_No response_\r\n\r\n### Install tools\r\n\r\n<details>\r\n\r\n</details>\r\n\r\n\r\n### Container runtime (CRI) and version (if applicable)\r\n\r\n<details>\r\n\r\n</details>\r\n\r\n\r\n### Related plugins (CNI, CSI, ...) and versions (if applicable)\r\n\r\n<details>\r\n\r\n</details>\r\n',
