      active_lock_reason: null,
      body: "Hi Team,\r\n\r\nI am facing issue with the multiple instances of the pods running. So I have an application inside pods that publishes different value to my UI ( Constantly, unless I change the request or stop taking the response) as I request. I have all the communication in place and my entire setup runs perfectly fine with single replicas. But as soon as I move to multiple replicas my entire setup starts behaving randomly. So with multiple pods when I request some values it goes to one of the pods. And when I request another value the request goes to the other replicas and both values are received at the same. When I checked the logs the request are going to different replicas. So if **Pod1** is responding to **start** then pod1 should only react to my **stop**. And when I again **start** it can go to any other pod then the corresponding **stop** should go to same pod \r\n\r\n**Expected Behaviour:**\r\nWhen I request the value, the traffic or the request goes to one of the pods. When I request some other values that request either should go to same pod and override the previous request or should load balance itself to other pod but stops or override the previous request.\r\n\r\n**Observed Behaviour:**\r\nWith multiple instances the request are going to different pods and publishing different values or response simultaneously instead of just one value.\r\n\r\n**What I am looking for ?**\r\n\r\n1. Is there any way I can control the pods my request should go or when we request for other values the previous pod should stop giving response and only the latest response I receive.\r\n\r\n2. Lets say when start my request it goes to pod 1 and when I stop the request that also should go pod1 rather than any other pods. Because if my start request goes to pod1 and stop request goes to pod2 it doesn't help me because pod2 isnt the one publishing the values. \r\n\r\nNot sure If I was able to explain my issue.",
