      body: "#### What type of PR is this?\r\n/kind feature\r\n\r\n#### What this PR does / why we need it:\r\nDefault AnyVolumeDataSource feature gate to enabled, as the feature is moving to beta.\r\n\r\n#### Which issue(s) this PR fixes:\r\nFixes #99955\r\n\r\n#### Special notes for your reviewer:\r\n\r\n#### Does this PR introduce a user-facing change?\r\n```release-note\r\nAnyVolumeDataSource feature gate is enabled by default. In order to provide user feedback on PVCs with data sources, deployers must install the VolumePopulators CRD and the data-source-validator controller.\r\n```\r\n\r\n#### Additional documentation e.g., KEPs (Kubernetes Enhancement Proposals), usage docs, etc.:\r\n```docs\r\n[KEP]: 1495\r\n```\r\n",
