      body: "**What happened**:\r\n\r\nA pod failed due to an initContainer failure and the main container was marked as `Terminated`:\r\n\r\n```yaml\r\ninitContainerStatuses:\r\n  - state:\r\n      terminated:\r\n        exitCode: 103\r\n        reason: Error\r\n        startedAt: '2022-03-16T07:00:00Z'\r\n        finishedAt: '2022-03-16T07:00:00Z'\r\n        # ...\r\n    lastState: {}\r\n    ready: false\r\n    restartCount: 0\r\n    # ...\r\ncontainerStatuses:\r\n  - state:\r\n      terminated:\r\n        exitCode: 137\r\n        reason: ContainerStatusUnknown\r\n        message: The container could not be located when the pod was terminated\r\n        startedAt: null\r\n        finishedAt: null\r\n    lastState: {}\r\n    ready: false\r\n    restartCount: 0\r\n    started: false\r\n    # ...\r\n```\r\n\r\n**What you expected to happen**:\r\n\r\nThe main container should stay in `Waiting` since it hasn't started (as described [in the docs](https://kubernetes.io/docs/concepts/workloads/pods/pod-lifecycle/#container-state-terminated): \"_A container in the Terminated state began execution and then either ran to completion or failed for some reason_\").\r\n\r\n```yaml\r\ninitContainerStatuses:\r\n  - state:\r\n      terminated:\r\n        exitCode: 103\r\n        reason: Error\r\n        startedAt: '2022-03-15T07:00:00Z'\r\n        finishedAt: '2022-03-15T07:00:00Z'\r\n        # ...\r\n    lastState: {}\r\n    ready: false\r\n    restartCount: 0\r\n    # ...\r\ncontainerStatuses:\r\n  - state:\r\n      waiting:\r\n        reason: PodInitializing\r\n    lastState: {}\r\n    ready: false\r\n    restartCount: 0\r\n    started: false\r\n    # ...\r\n```\r\n\r\n**How to reproduce it (as minimally and precisely as possible)**:\r\n\r\nCreate a pod with an initContainer that will fail. After the pod fails, inspect the main container status and you should see it in `Terminated` state instead of the `Waiting` expected state.\r\n\r\n**Anything else we need to know?**:\r\n\r\nI believe it might be a regression from https://github.com/kubernetes/kubernetes/pull/105462 that was [backported in v1.22.3](https://github.com/kubernetes/kubernetes/pull/105496) since we removed the `|| status.ContainerStatuses[i].State.Waiting != nil` check that was making sure only previously-running containers could end up as `Terminated`.\r\n\r\nI noticed there was a test added in [kubernetes/kubernetes/pkg/kubelet/status/status_manager_test.go#L639](https://github.com/kubernetes/kubernetes/blob/7152825c0695d62fe06b47cc3e1699095290d73f/pkg/kubelet/status/status_manager_test.go#L639) as part of this PR so I'm not sure if this change was intentional (and undocumented) or just overlooked.\r\n\r\nThis is problematic since many systems expect `Terminated` containers to have started as documented in the docs. A workaround might be to rely `containerStatuses[i].state.terminated.startedAt` in addition to `containerStatuses[i].state.terminated` but I'm curious to know if this was an intentional change and the documentation should be updated or if it's a regression that should be fixed.\r\n\r\n**Environment**:\r\n- Kubernetes version: First saw in `v1.22` and was able to reproduce it in `master`.\r\n\r\n/kind bug\r\n/sig node",
