      body: '### What happened?\r\n\r\nreposting following @neolit123 \'s suggestion : [90158](https://github.com/kubernetes/kubernetes/issues/90158#issuecomment-1068956071)\r\n\r\nAs per [documentation](https://kubernetes.io/docs/setup/production-environment/tools/kubeadm/install-kubeadm/), installing kubeadm, kubelet and kubectl on rhel releases (el7) using the following configuration where K8S_VERSION=1.21.10 (also tried with 1.19.15)\r\n\r\n```\r\necho "Kubernetes version: $K8S_VERSION"\r\ncat <<EOF | sudo tee /etc/yum.repos.d/kubernetes.repo\r\n[kubernetes]\r\nname=Kubernetes\r\nbaseurl=https://packages.cloud.google.com/yum/repos/kubernetes-el7-\\$basearch\r\nenabled=1\r\ngpgcheck=1\r\nrepo_gpgcheck=1\r\ngpgkey=https://packages.cloud.google.com/yum/doc/yum-key.gpg https://packages.cloud.google.com/yum/doc/rpm-package-key.gpg\r\nexclude=kubelet kubeadm kubectl\r\nEOF\r\n\r\n# Set SELinux in permissive mode (effectively disabling it)\r\nsudo setenforce 0\r\nsudo sed -i \'s/^SELINUX=enforcing$/SELINUX=permissive/\' /etc/selinux/config\r\n\r\nsudo yum install -y kubelet-$K8S_VERSION kubeadm-$K8S_VERSION kubectl-$K8S_VERSION --disableexcludes=kubernetes\r\n\r\nsudo systemctl enable --now kubelet\r\n```\r\n\r\n\r\n```\r\nKubernetes version: 1.21.10\r\n[kubernetes]\r\nname=Kubernetes\r\nbaseurl=https://packages.cloud.google.com/yum/repos/kubernetes-el7-$basearch\r\nenabled=1\r\ngpgcheck=1\r\nrepo_gpgcheck=1\r\ngpgkey=https://packages.cloud.google.com/yum/doc/yum-key.gpg https://packages.cloud.google.com/yum/doc/rpm-package-key.gpg\r\nexclude=kubelet kubeadm kubectl\r\nLoaded plugins: fastestmirror\r\nLoading mirror speeds from cached hostfile\r\n * base: mirror.plusserver.com\r\n * epel: mirror.23m.com\r\n * extras: mirror.plusserver.com\r\n * updates: mirror.plusserver.com\r\nRetrieving key from https://packages.cloud.google.com/yum/doc/yum-key.gpg\r\nImporting GPG key 0x7AA99B80:\r\n Userid     : "Rapture Automatic Signing Key (cloud-rapture-signing-key-2022-03-07-08_01_01.pub)"\r\n Fingerprint: e89b faec 34d3 1829 362f 7f7b 5668 44f3 7aa9 9b80\r\n From       : https://packages.cloud.google.com/yum/doc/yum-key.gpg\r\nRetrieving key from https://packages.cloud.google.com/yum/doc/rpm-package-key.gpg\r\nhttps://packages.cloud.google.com/yum/repos/kubernetes-el7-x86_64/repodata/repomd.xml: [Errno -1] repomd.xml signature could not be verified for kubernetes\r\nTrying other mirror.\r\n\r\n\r\n One of the configured repositories failed (Kubernetes),\r\n and yum doesn\'t have enough cached data to continue. At this point the only\r\n safe thing yum can do is fail. There are a few ways to work "fix" this:\r\n\r\n     1. Contact the upstream for the repository and get them to fix the problem.\r\n\r\n     2. Reconfigure the baseurl/etc. for the repository, to point to a working\r\n        upstream. This is most often useful if you are using a newer\r\n        distribution release than is supported by the repository (and the\r\n        packages for the previous distribution release still work).\r\n\r\n     3. Run the command with the repository temporarily disabled\r\n            yum --disablerepo=kubernetes ...\r\n\r\n     4. Disable the repository permanently, so yum won\'t use it by default. Yum\r\n        will then just ignore the repository until you permanently enable it\r\n        again or use --enablerepo for temporary usage:\r\n\r\n            yum-config-manager --disable kubernetes\r\n        or\r\n            subscription-manager repos --disable=kubernetes\r\n\r\n     5. Configure the failing repository to be skipped, if it is unavailable.\r\n        Note that yum will try to contact the repo. when it runs most commands,\r\n        so will have to try and fail each time (and thus. yum will be be much\r\n        slower). If it is a very temporary problem though, this is often a nice\r\n        compromise:\r\n\r\n            yum-config-manager --save --setopt=kubernetes.skip_if_unavailable=true\r\n\r\nfailure: repodata/repomd.xml from kubernetes: [Errno 256] No more mirrors to try.\r\nhttps://packages.cloud.google.com/yum/repos/kubernetes-el7-x86_64/repodata/repomd.xml: [Errno -1] repomd.xml signature could not be verified for kubernetes\r\n```\r\n\r\n### What did you expect to happen?\r\n\r\nExpected the command `\r\nsudo yum install -y kubelet-$K8S_VERSION kubeadm-$K8S_VERSION kubectl-$K8S_VERSION --disableexcludes=kubernetes` to succeed, where $K8S_VERSION=1.21.10 \r\n\r\n### How can we reproduce it (as minimally and precisely as possible)?\r\n\r\n- Provision an el7 machine (physical or virtual). \r\n- Follow the [doc](https://kubernetes.io/docs/setup/production-environment/tools/kubeadm/install-kubeadm/) to setup a red hat release node (el7) with kubeadm, kubelet, kubectl\r\n- This fails whether you are initialising a new cluster or whether you are joining a new node to an existing  cluster\r\n\r\n### Anything else we need to know?\r\n\r\nI haven\'t changed the scripts I use to setup new k8s clusters/add new nodes for a while. I checked the process up until  the point where the installation fails. Nothing seems to have really changed compared to the documentation.\r\n\r\nI was able to successfully install a ubuntu machine with k8s (using the appropriate process of course)\r\n\r\n### Kubernetes version\r\n\r\n\r\n```\r\n1.21.10 and 1.19.15 (separate)\r\n```\r\n\r\n\r\n\r\n### Cloud provider\r\n\r\nOVH\r\n\r\n\r\n\r\n### OS version\r\n\r\n\r\n```console\r\n$ uname -a\r\nLinux worker-2 3.10.0-1160.53.1.el7.x86_64 #1 SMP Fri Jan 14 13:59:45 UTC 2022 x86_64 x86_64 x86_64 GNU/Linux\r\n```\r\n\r\n\r\n```\r\n$ hostnamectl\r\n   Static hostname: worker-2\r\n         Icon name: computer-vm\r\n           Chassis: vm\r\n        Machine ID: cab9605edaa5484da7c2f02b8fd10762\r\n           Boot ID: 90b6f0148edc41f98250f1f6273a896c\r\n    Virtualization: kvm\r\n  Operating System: CentOS Linux 7 (Core)\r\n       CPE OS Name: cpe:/o:centos:centos:7\r\n            Kernel: Linux 3.10.0-1160.53.1.el7.x86_64\r\n      Architecture: x86-64\r\n$ cat /etc/os-release \r\nNAME="CentOS Linux"\r\nVERSION="7 (Core)"\r\nID="centos"\r\nID_LIKE="rhel fedora"\r\nVERSION_ID="7"\r\nPRETTY_NAME="CentOS Linux 7 (Core)"\r\nANSI_COLOR="0;31"\r\nCPE_NAME="cpe:/o:centos:centos:7"\r\nHOME_URL="https://www.centos.org/"\r\nBUG_REPORT_URL="https://bugs.centos.org/"\r\n\r\nCENTOS_MANTISBT_PROJECT="CentOS-7"\r\nCENTOS_MANTISBT_PROJECT_VERSION="7"\r\nREDHAT_SUPPORT_PRODUCT="centos"\r\nREDHAT_SUPPORT_PRODUCT_VERSION="7"\r\n```\r\n\r\n\r\n\r\n\r\n### Install tools\r\n\r\nyum, kubeadm\r\n\r\n### Container runtime (CRI) and version (if applicable)\r\n\r\n_No response_\r\n\r\n### Related plugins (CNI, CSI, ...) and versions (if applicable)\r\n\r\n_No response_',
