      body: 'Problem summary:\r\n* We have a metadata field clusterName, added for the first take on federation many years ago.\r\n* It’s force-cleared on read and write paths, since we couldn’t figure out what to do with it.\r\n* Although clients will read, parse, and echo back the field, the semantics have never been defined. No one knows what this field “means”.\r\n* It has come to my attention that at least one kube-derivative project (KCP) is using this field, by disabling the server code that clears this field.\r\n\r\n**Main concern**: Multiple projects seeking interoperability with vanilla OSS k8s, each extending the api in similar but non-compatible ways, leading to ecosystem fracture.\r\n\r\nSuggested way to fix this:\r\n* As we did for CRD group names, we should reserve all unqualified field names within metadata (indeed, the entire k8s-owned API surface) for the future exclusive use of the kubernetes project.\r\n* New policy:\r\n  * Users wanting non-standard within-api-object extension fields therefore need to prefix any such field name with some unambiguous and unlikely-to-collide project identifier.\r\n  * Additionally, those customizing the api in that way need to agree to transition onto a standardized k8s field within a reasonable amount of time (2 years?), in the event that k8s decides that the concept is useful and creates a standardized field for it.\r\n* Code changes:\r\n  * Remove the ClusterName field, to reduce the temptation to misuse it. Lack of semantics makes it both especially tempting to re-use this field, and also especially likely to be incompatible with others’ use of the field. Because this field is force cleared on read AND write, it is unusually safe to remove.\r\n\r\nETA: This PR renames the ClusterName field in the go struct / interface while leaving it serialized. This will help clients detect any accidental use. Next release we will remove it completely. (I personally think this is probably an excessive amount of caution, but see the discussion below)\r\n\r\n/kind cleanup\r\n/kind api-change\r\n/kind deprecation\r\n\r\n/sig arch\r\n/sig api-machinery\r\n\r\n\r\n#### Does this PR introduce a user-facing change?\r\n<!--\r\nIf no, just write "NONE" in the release-note block below.\r\nIf yes, a release note is required:\r\nEnter your extended release note in the block below. If the PR requires additional action from users switching to the new release, include the string "action required".\r\n\r\nFor more information on release notes see: https://git.k8s.io/community/contributors/guide/release-notes.md\r\n-->\r\n```release-note\r\nThe metadata.clusterName field is deprecated. This field has always been unwritable and always blank, but its presence is confusing, so we will remove it next release. Out of an abundance of caution, this release we have merely changed the name in the go struct to ensure any accidental client uses are found before complete removal.\r\n```\r\n\r\n',
