      body: "#### What type of PR is this?\r\n\r\n/kind cleanup\r\n\r\n#### What this PR does / why we need it:\r\n\r\nThis is the first PR in a series of audit logging refactors (broken up for smaller PRs) to clean up the audit handling in the request chain. This PR does the following:\r\n\r\n1. Remove unused k8s.io/apiserver/pkg/audit/event package\r\n2. Add a new `AddAuditAnnotations` method for bulk-adding audit annotations\r\n3. Eliminate direct modification of the audit event outside of the audit package (`AddAuditAnnotation(s)` is the only way to log annotations now)\r\n4. Make AddAuditAnnotation(s) thread-safe by storing a mutex on the audit context. In a future PR, I will consolidate all the audit context variables into a single object.\r\n\r\n#### Does this PR introduce a user-facing change?\r\n```release-note\r\nNONE\r\n```\r\n\r\n/sig api-machinery auth\r\n/assign @liggitt ",
