      author_association: "CONTRIBUTOR",
      active_lock_reason: null,
      body: "### Which jobs are flaking?\n\nWe are seeing a various test flakes in https://testgrid.k8s.io/sig-windows-signal#capz-windows-containerd-master where Windows pods encountering errors making calls to httpd pods.\r\n\r\n\r\n\n\n### Which tests are flaking?\n\nWe have seen these flakes in the following tests:\r\n- [sig-node] Container Lifecycle Hook when create a pod with lifecycle hook should execute prestop exec hook properly [NodeConformance] [Conformance]\r\n- [sig-apps] StatefulSet Basic StatefulSet functionality [StatefulSetBasic] should perform rolling updates and roll backs of template modifications [Conformance]\r\n- [sig-network] Services should serve multiport endpoints from pods [Conformance]\r\n- and more\r\n\r\nLogs\r\n- https://prow.k8s.io/view/gs/kubernetes-jenkins/logs/ci-kubernetes-e2e-capz-master-containerd-windows/1503162834484203520\n\n### Since when has it been flaking?\n\nA few months?\n\n### Testgrid link\n\nhttps://prow.k8s.io/view/gs/kubernetes-jenkins/logs/ci-kubernetes-e2e-capz-master-containerd-windows/1503162834484203520\n\n### Reason for failure (if possible)\n\n_No response_\n\n### Anything else we need to know?\n\n_No response_\n\n### Relevant SIG(s)\n\n/sig windows",
