      active_lock_reason: null,
      body: '### What happened?\r\n\r\nI want to check of a group I reference in a role-binding I created in current namespace can exec into pods, namely I want to confirm that users in group `my-group` can use `kubectl exec`. \r\n\r\nThe following, based on specifying the command I want to use rather than the API equivalent, did not work: \r\n```console\r\n$ kubectl auth can-i --as=* --as-group=my-group exec pods\r\nWarning: verb \'exec\' is not a known verb\r\nno\r\n```\r\n\r\nI find out I need the individual verbs of the API, not the kubectl command I am testing, and I find out via web search that for `kubectl exec`, the verbs are `create` and `get` on `pods/exec`. \r\n\r\nSo let\'s try that. \r\n\r\nI am cluster-owner so answer should be yes: \r\n```console\r\n$ kubectl auth can-i create pods/exec\r\nyes\r\n```\r\nNow for the user in group `my-group`: \r\n```console\r\n$ kubectl auth can-i --as=* --as-group=my-group create pods/exec\r\nno\r\n```\r\nBut any user in group `my-group` actually can exec into pods: \r\n```console\r\n$ kubectl --as=* --as-group=my-group exec -it deploy/my-deploy -- bash\r\napp@my-deploy-76874c746-jfvms:/app$ exit\r\nexit\r\n```\r\n\r\nOK, disconcerting. Then I find out about subresource, this gives the correct answer: \r\n```console\r\n$ kubectl auth can-i --as=* --as-group=my-group create pods --subresource exec\r\nyes\r\n```\r\n\r\nNote that, in addition to the check that returned yes with pod/exec when I am cluster-owner, but no when I am a user, but worked with subresource, there can be typos, I have no way of knowing: \r\n```console\r\n$ kubectl auth can-i --as=* --as-group=my-group create pods/exec2\r\nno\r\n$ kubectl auth can-i --as=* --as-group=my-group create pods --subresource exec2\r\nno\r\n```\r\n\r\n### What did you expect to happen?\r\n\r\nSeveral things: \r\n\r\n1. if a subresource is not known, there should be an error, not a negative answer\r\n2. the subresource should be consistent in both formats, ie using `--subresource` and using `resourceType/subresource`\r\n3. we should not be asking the user to know the verbs; the command should be sufficient ie `kubectl auth can-i` should do the conversion (so for `exec`, `kubectl auth can-i` should request the API for `create pods` with subresource `exec`)\r\n\r\n\r\n### How can we reproduce it (as minimally and precisely as possible)?\r\n\r\nSee the first section\r\n\r\n### Anything else we need to know?\r\n\r\n_No response_\r\n\r\n### Kubernetes version\r\n\r\n<details>\r\n\r\n```console\r\n$ kubectl version\r\nClient Version: version.Info{Major:"1", Minor:"21", GitVersion:"v1.21.9", GitCommit:"b631974d68ac5045e076c86a5c66fba6f128dc72", GitTreeState:"clean", BuildDate:"2022-01-19T17:51:12Z", GoVersion:"go1.16.12", Compiler:"gc", Platform:"darwin/amd64"}\r\nServer Version: version.Info{Major:"1", Minor:"20+", GitVersion:"v1.20.11-eks-f17b81", GitCommit:"f17b810c9e5a82200d28b6210b458497ddfcf31b", GitTreeState:"clean", BuildDate:"2021-10-15T21:46:21Z", GoVersion:"go1.15.15", Compiler:"gc", Platform:"linux/amd64"}\r\n```\r\n\r\n</details>\r\n\r\n\r\n### Cloud provider\r\n\r\n<details>\r\nAWS EKS with kubernetes 1.20.7\r\n</details>\r\n\r\n\r\n### OS version\r\n\r\n<details>\r\n\r\n```console\r\n$ cat /etc/os-release\r\ncat: /etc/os-release: No such file or directory\r\n$ uname -a\r\nDarwin mymachine 20.6.0 Darwin Kernel Version 20.6.0: Wed Jun 23 00:26:31 PDT 2021; root:xnu-7195.141.2~5/RELEASE_X86_64 x86_64```\r\n\r\n</details>\r\n\r\n\r\n### Install tools\r\n\r\n<details>\r\n\r\n</details>\r\n\r\n\r\n### Container runtime (CRI) and version (if applicable)\r\n\r\n<details>\r\n\r\n</details>\r\n\r\n\r\n### Related plugins (CNI, CSI, ...) and versions (if applicable)\r\n\r\n<details>\r\n\r\n</details>\r\n',
